import React, { Component } from 'react';
import { Table } from 'reactstrap';

class TableComponent extends Component {
    render () {
        return (
            <div>
                {/* <h1>Deliveries</h1> */}
                <Table class="table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Driver</th>
                            <th>&nbsp;</th>
                        </tr>
                    </thead>
                    <tbody>

                    </tbody>
                </Table>
            </div>
        );
    }
}

export default TableComponent;
